import React from "react";
import "../styles/App.css";

const projects = [
  {
    name: "Go Job Scraper",
    description: "CLI app that scrapes business websites for career pages using Go.",
    language: "Go",
    stars: 7,
    updated: "July 2025",
  },
  {
    name: "Music Library",
    description: "Wails + Go + React music manager with FLAC/WAV support.",
    language: "TypeScript",
    stars: 12,
    updated: "June 2025",
  },
];

export default function Projects() {
  return (
    <div className="page-container">
      <h2 className="page-title">Projects</h2>
      <div className="repo-list">
        {projects.map((proj, i) => (
          <div key={i} className="repo-card">
            <div className="repo-header">
              <span className="repo-name">{proj.name}</span>
              <span className="repo-stars">★ {proj.stars}</span>
            </div>
            <p className="repo-description">{proj.description}</p>
            <div className="repo-meta">
              <span className="repo-lang">{proj.language}</span>
              <span>• Updated {proj.updated}</span>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}
